/* Barre de navigation */
.top-nav {
   background-color: #ffffff;
  display: flex;
  flex-wrap: wrap;
  gap: 12px;
}

/* Boutons de navigation */
.nav-btn {
  background-color: transparent;
  border: 1px solid transparent;
  padding: 10px 18px;
  border-radius: 8px;
  font-size: 14px;
  font-weight: 500;
  color: #555;
  cursor: pointer;
  transition: all 0.2s ease-in-out;
}

/* Hover effect */
.nav-btn:hover {
  background-color: #f0f0f0;
  border-color: #dcdcdc;
  color: #007bff;
}

/* Bouton actif */
.nav-btn.active {
  background-color: #007bff;
  color: white;
  border-color: #007bff;
  box-shadow: 0 4px 10px rgba(0, 123, 255, 0.25);
}

/* Bouton logout spécifique */
.nav-btn.logout {
  margin-left: auto;
  background-color: #e74c3c;
  color: white;
  font-weight: 600;
}

.nav-btn.logout:hover {
  background-color: #c0392b;
  box-shadow: 0 4px 10px rgba(231, 76, 60, 0.25);
}  
